import './App.css';
import { getWeatherApi } from './api/weather.js'
import { useEffect } from 'react';

function App() {

  let setValues = (weather) => {
    console.log(weather.currentConditions)
  }

  useEffect(() => {
    getWeatherApi()
      .then(weather => setValues(weather));
  })

  return (
    <div className="App">
      <header className="App-header">
        <h1>Hello world</h1>
        <p>{weather.currentConditions}</p>
      </header>
    </div>
  );
}

export default App;
